
var elements=document.querySelectorAll('[data-toggle]');Array.prototype.forEach.call(elements,function(el,i){el.addEventListener('click',function(){var elements=document.querySelectorAll('[data-target='+el.getAttribute('data-toggle')+']');Array.prototype.forEach.call(elements,function(el,i){el.classList.toggle('is-active');});});});var elements=document.querySelectorAll('[data-hide]');Array.prototype.forEach.call(elements,function(el,i){el.addEventListener('click',function(){var elements=document.querySelectorAll('[data-target='+el.getAttribute('data-hide')+']');Array.prototype.forEach.call(elements,function(el,i){el.remove();});});});var elements=document.querySelectorAll('[data-toggle-dialog]');Array.prototype.forEach.call(elements,function(el,i){el.addEventListener('click',function(){var elements=document.querySelectorAll('[data-target='+el.getAttribute('data-toggle-dialog')+']');Array.prototype.forEach.call(elements,function(el,i){el.classList.toggle('is-hidden');});});});